import React from 'react';
import './Servicos.css';

const Servicos = () => {
    return (
        <section id="servicos" className="servicos">
            <h2 className="titulo-secao">Serviços</h2>
            <p>Ofereço uma gama de soluções digitais:</p>
            <div className="servicos-lista">
                <div className="servico-card">
                    <h3>Desenvolvimento de Sites</h3>
                    <p>Criação de sites institucionais, hotsites, landing pages e muito mais.</p>
                </div>
                <div className="servico-card">
                    <h3>E-commerce</h3>
                    <p>Montagem de lojas virtuais completas com funcionalidades de gerenciamento.</p>
                </div>
                <div className="servico-card">
                    <h3>Sistemas Personalizados</h3>
                    <p>Desenvolvimento de sistemas sob medida para necessidades específicas do negócio.</p>
                </div>
            </div>
        </section>
    );
};

export default Servicos;
